import './App.css';

function App() {
  return (
    <div>
      <h1>가계부</h1>

      <label>
        <input type="radio" name="import" value="import">수입</input>

        <input type="radio" name="expenditure" value="expenditure">지출</input>
      </label>

      <input type='text' placeholder='0'></input>
    </div>
  );
}

export default App;
